import React from 'react'
import Layout from '../components/Layout';
import Dock from '../components/Dock';
import Link from 'next/link';

export default class Business extends React.Component {
render() {
    return (
      <Layout>
      <Link href='/consumer'><p>link</p></Link>
      <div className="consumer-parent">
      <div className="consumer-child">
      <img className="consumer-image" src="/Business.png" alt="text" />
      <Dock></Dock>
      <div>

      </div>
      </div>
      </div>



      <style jsx>{`
      .consumer-image {
          top: 60px;
          position: relative;

      }

      .consumer-parent {
          display: flex;
          align-items: center;
          justify-content: center;
      }


      .consumer-child {
          padding-top: 23px;
      }
    `}</style>


      </Layout>
    );
  }
}
